class FinanceTrade {
    private $common;
    private $commonService;
    private $financeService;

    public function __construct() {
        $this->common = requireModule("Common");
        $this->commonService = requireService("Common");
        $this->financeService = requireService("Finance");
    }

    public function insertTrade() {
        //消费
        $param = array();
        $param['type'] = 1;//类型, 1=现金消费, 2=充值消费, 3=收益消费
        $selectFinanceConsumeResp = $this->financeService->selectFinanceConsume($param);
        if ($selectFinanceConsumeResp->errCode != 0) {
            $this->common->logger->info('消费查询异常');
            return;
        }
        $consumeList = $selectFinanceConsumeResp->data['list'];
        //充值
        $param = array();
        $param['financeType'] = 0;//资金类型, 0=方案, 1=出票
        $param['type'] = 1;//类型, 1=用户充值, 2=平台充值
        $selectFinanceChargeResp = $this->financeService->selectFinanceCharge($param);
        if ($selectFinanceChargeResp->errCode != 0) {
            $this->common->logger->info('充值查询异常');
            return;
        }
        $chargeList = $selectFinanceChargeResp->data['list'];
        //合并处理
        $tradeList = array();
        foreach ($consumeList as $consume) {
            $financeType = (int)$consume['financeType'];
            $userId = (int)$consume['userId'];
            $nickName = trim($consume['nickName']);
            $realName = trim($consume['realName']);
            $orderId = (int)$consume['orderId'];
            $amount = (int)$consume['amount'];
            $createTime = trim($consume['createTime']);
            if ($userId <= 0 || $orderId <= 0 || $amount <=0) {
                continue;
            }
            $info = array(
                'tradeType' => '0',//交易类型, 0=爱贝, 1=支付宝
                'financeType' => $financeType,
                'type' => 1,//类型, 1=消费, 2=充值'
                'userId' => $userId,
                'nickName' => $nickName,
                'realName' => $realName,
                'orderId' => $orderId,
                'amount' => $amount,
                'createTime' => $createTime
            );
            $tradeList[] = $info;
        }
        foreach ($chargeList as $charge) {
            $financeType = (int)$charge['financeType'];
            $userId = (int)$charge['userId'];
            $nickName = trim($charge['nickName']);
            $realName = trim($charge['realName']);
            $orderId = (int)$charge['orderId'];
            $amount = (int)$charge['amount'];
            $createTime = trim($charge['createTime']);
            if ($userId <= 0 || $orderId <= 0 || $amount <=0) {
                continue;
            }
            $info = array(
                'tradeType' => '0',//交易类型, 0=爱贝, 1=支付宝
                'financeType' => $financeType,
                'type' => 2,//类型, 1=消费, 2=充值'
                'userId' => $userId,
                'nickName' => $nickName,
                'realName' => $realName,
                'orderId' => $orderId,
                'amount' => $amount,
                'createTime' => $createTime
            );
            $tradeList[] = $info;
        }
        $orderIdArr = array();
        foreach ($tradeList as $trade) {
            $orderIdArr[] = trim($trade['orderId']);
        }
        array_multisort($orderIdArr, SORT_ASC, SORT_NUMERIC, $tradeList);
        $database = requireModule("Database");
        $sqlArr = array();
        for ($i = 0, $length = count($tradeList); $i < $length; $i++) {
            $trade = $tradeList[$i];
            $tradeType = (int)$trade['tradeType'];
            $financeType = (int)$trade['financeType'];
            $type = (int)$trade['type'];
            $userId = (int)$trade['userId'];
            $nickName = trim($trade['nickName']);
            $realName = trim($trade['realName']);
            $orderId = (int)$trade['orderId'];
            $amount = (int)$trade['amount'];
            $createTime = trim($trade['createTime']);
            $field = array();
            $field[] = 'tradeType="' . $database->escape($tradeType) . '"';//交易类型, 0=爱贝, 1=支付宝
            $field[] = 'financeType="' . $database->escape($financeType) . '"';
            $field[] = 'type="' . $database->escape($type) . '"';//类型, 1=消费, 2=充值'
            $field[] = 'userId="' . $database->escape($userId) . '"';
            $field[] = 'nickName="' . $database->escape($nickName) . '"';
            $field[] = 'realName="' . $database->escape($realName) . '"';
            $field[] = 'orderId="' . $database->escape($orderId) . '"';
            $field[] = 'amount="' . $database->escape($amount) . '"';
            $field[] = 'createTime="' . $database->escape($createTime) . '"';
            $field[] = 'lastTime="' . $database->escape($createTime) . '"';
            $sqlArr[] = 'insert into t_finance_trade set ' . implode(',', $field);
        }
        if (count($sqlArr) > 0) {
            $sql = implode(';', $sqlArr);
            $result = $database->multiExecute($sql);
            $database->multiFree();
            if ($result) {
                $this->common->logger->info('交易插入成功');
            } else {
                $this->common->logger->info('交易插入失败');
            }
        }
        $database->close();
    }

    public function setTrade() {
        //消费
        $param = array();
        $param['needNullTradeNo'] = true;
        $selectFinanceTradeResp = $this->financeService->selectFinanceTrade($param);
        if ($selectFinanceTradeResp->errCode != 0) {
            $this->common->logger->info('交易查询异常');
            return;
        }
        $tradeList = $selectFinanceTradeResp->data['list'];
        $database = requireModule("Database");
        global $curEnv;
        foreach ($tradeList as $trade) {
            $tradeId = (int)$trade['tradeId'];
            $orderId = (int)$trade['orderId'];
            $amount = (int)$trade['amount'];
            if ($tradeId <= 0 || $orderId <= 0 || $amount <= 0) {
                continue;
            }
            $iapppay = requireModule('Iapppay');
            $param = array();
            $param['orderId'] = $orderId;
            $queryPayResp = $iapppay->queryPay($param);
            if ($queryPayResp->errCode == 0) {
                $data = $queryPayResp->data;
                $tradeNo = trim($data->transid);
                $tradeTime = trim($data->transtime);
                $money = (float)$data->money;
                $remark = '';
                //只有正式环境，才去校验金额，测试环境都是1分钱(方便测试)
                if ($curEnv == 'dist' && $money*100 != $amount) {
                    $remark = '商户和交易平台的价格不匹配';
                }
                $field = array();
                $field[] = 'tradeNo="' . $database->escape($tradeNo) . '"';
                $field[] = 'tradeTime="' . $database->escape($tradeTime) . '"';
                $field[] = 'remark="' . $database->escape($remark) . '"';
                $sql = 'update t_finance_trade set ' . implode(',', $field) . ' where tradeId="' . $tradeId . '" limit 1';
                $database->execute($sql);
            }
            sleep(1);
        }
        $database->close();
    }

